import React from 'react';
import logo from '../static/Logo.jpg';
import './styles/navbar.css'


function Navbar() {
    return (
        <div>
            <header>
                
            </header>
            <nav className = "flex flex-jc-sb">
                <a className = "navbar__logo">
                    <img src = {logo}></img>
                    <h4>DirtyBits</h4>
                </a>
            </nav>
        </div>
    )
}

export default Navbar;
